import { useState } from 'react'
import { Link, useNavigate } from 'react-router-dom'
import { toast } from 'react-toastify'
import { registerUser as registerUserApi } from '../services/user'

function Paymentpage() {
    const [cardNumber, setCardNumber] = useState('');
    const [expiryDate, setExpiryDate] = useState('');
    const [cvv, setCVV] = useState('');
    const [name, setName] = useState('');
    const [paymentSuccess, setPaymentSuccess] = useState(false);

  return (
    <div>
      <h1 style={{ textAlign: 'center', margin: 10 }}>Payment Page</h1>

      <div className='row'>
        <div className='col'></div>
        <div className='col'>
          <div className='form'>
            <table className='table'>
              <tbody>
                <tr>
                  <td><label>Card Number</label></td>
                  <td>
                    <input
                      type='text'
                      className='form-control'
                      onChange={(e) => {
                        setCardNumber(e.target.value)
                      }}
                    />
                  </td>
                </tr>
                <tr>
                  <td><label>Name on Card</label></td>
                  <td>
                    <input
                      type='text'
                      className='form-control'
                      onChange={(e) => {
                        setName(e.target.value)
                      }}
                    />
                  </td>
                </tr>
                <tr>
                  <td><label>CVV Number</label></td>
                  <td>
                    <input
                      type='text'
                      className='form-control'
                      onChange={(e) => {
                        setCVV(e.target.value)
                      }}
                    />
                  </td>
                </tr>
                <tr>
                  <td><label>Expiry Date</label></td>
                  <td>
                    {/* Dropdown for Month */}
                    <div className="dropdown">
                      <button className="btn btn-secondary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
                        Month
                      </button>
                      <ul className="dropdown-menu">
                        {/* Months options */}
                      </ul>
                    </div>
                    
                    {/* Dropdown for Year */}
                    <div className="dropdown">
                      <button className="btn btn-secondary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
                        Year
                      </button>
                      <ul className="dropdown-menu">
                        {/* Year options */}
                      </ul>
                    </div>
                  </td>
                </tr>
              </tbody>
            </table>

            <div className='mb-3'>
              <div className='mb-3'>
                Add new Bank Account <Link to='/'>Add</Link>
              </div>
              <button className='btn btn-success'>
                Pay Now
              </button>
            </div>
          </div>
        </div>
        <div className='col'></div>
      </div>
    </div>
  )
}

export default Paymentpage
